    value: In response to your letter of October 1
  - value: ' 2002:  Best efforts policy is to include a Contribution Statement form
      with all written solicitations requesting the FECA required infomration: name;
      address; occupation and employer.  Also include statement that federal law requires
      we request the above information on any contributor whose contributions exceed
      $200.  Contribution statements are included in all direct mail appeals as well
      as invitations to fundraising events.  A second request is made if the information
      is not received with the first request.  The second request is made within 30
      days of receipt of contribution by a telephone call from a committee member.  In
      some instances'
  - value: ' the Second Request is made in writing.  If the second request is sent
      in writing'
  - value: ' a postage paid pre-addressed envelope for the return is included.'
